import './ActionButton.css';

function ActionButton() {
  return (
    <div className="ActionButton">
        <button>
            <h2>Εξαγωγή</h2>
            <p>Εξαγωγή υλικών ή ρεταλιών απο την αποθήκη</p>
        </button>
    </div>
  );
}

export default ActionButton;
